DROP TABLE IF EXISTS OPERACION;
DROP TABLE IF EXISTS INMUEBLE;
DROP TABLE IF EXISTS COMPRADOR;
DROP TABLE IF EXISTS VENDEDOR;
DROP TABLE IF EXISTS TIPO;


CREATE TABLE COMPRADOR
(
  ID_CLIENTE INTEGER,
  NOMBRE VARCHAR(100),
  CONSTRAINT PK_COMPRADOR PRIMARY KEY (ID_CLIENTE)
);


CREATE TABLE INMUEBLE
(
  ID_INMUEBLE INTEGER,
  FECHA_ALTA DATE,
  TIPO_INMUEBLE INTEGER,
  TIPO_OPERACION VARCHAR(10),
  PROVINCIA VARCHAR(50),
  SUPERFICIE NUMERIC,
  PRECIO NUMERIC,
  CONSTRAINT PK_INMUEBLE PRIMARY KEY (ID_INMUEBLE)
);


CREATE TABLE OPERACION
(
  ID_INMUEBLE INTEGER,
  FECHA_OPERACION DATE,
  PRECIO_FINAL NUMERIC,
  ID_VENDEDOR INTEGER,
  ID_CLIENTE INTEGER,
  CONSTRAINT PK_OPERACION PRIMARY KEY (ID_INMUEBLE)
);


CREATE TABLE TIPO
(
  ID_TIPO INTEGER,
  NOMBRE VARCHAR(50),
  CONSTRAINT PK_TIPO PRIMARY KEY (ID_TIPO)
);


CREATE TABLE VENDEDOR
(
  ID_VENDEDOR INTEGER,
  NOMBRE VARCHAR(50),
  FECHA_CONTRATACION DATE,
  CONSTRAINT PK_VENDEDOR PRIMARY KEY (ID_VENDEDOR)
);












ALTER TABLE INMUEBLE ADD CONSTRAINT FK_INMUEBLE_TIPO FOREIGN KEY (TIPO_INMUEBLE)
	  REFERENCES TIPO (ID_TIPO);


ALTER TABLE OPERACION ADD CONSTRAINT FK_OPERACION_COMPRADOR FOREIGN KEY (ID_CLIENTE)
	  REFERENCES COMPRADOR (ID_CLIENTE);

ALTER TABLE OPERACION ADD CONSTRAINT FK_OPERACION_INMUEBLE FOREIGN KEY (ID_INMUEBLE)
	  REFERENCES INMUEBLE (ID_INMUEBLE);

ALTER TABLE OPERACION ADD CONSTRAINT FK_OPERACION_VENDEDOR FOREIGN KEY (ID_VENDEDOR)
	  REFERENCES VENDEDOR (ID_VENDEDOR);



/**
ACTUALIZACIÓN PARA 2022-23.
PARA 2023-24 SUMAR INTERVAL '5 YEAR'....
**/

UPDATE INMUEBLE
SET FECHA_ALTA = FECHA_ALTA + INTERVAL '4 YEAR' + INTERVAL '6 MONTH';

UPDATE OPERACION
SET FECHA_OPERACION = FECHA_OPERACION + INTERVAL '4 YEAR' + INTERVAL '6 MONTH';

UPDATE VENDEDOR
SET FECHA_CONTRATACION = FECHA_CONTRATACION + INTERVAL '4 YEAR';